import React, { useEffect, useState } from 'react';

const Monsters = () => {

  const [monsters, setMonsters] = useState([]);
  useEffect(() => {
    fetch('https://botw-compendium.herokuapp.com/api/v2/category/monsters')
    .then(res => res.json)
    .then(json => {
      setMonsters({
        monsters: json,
      })
    })
  })
  return ( 
    <div></div>
  );
}

export default Monsters;
